import React, { Component } from 'react';
import { w3cwebsocket as W3CWebSocket } from "websocket";

const client = new W3CWebSocket('ws://stream.tradingeconomics.com/?client=guest:guest');

class EURUSDrate extends Component {
  componentWillMount() {
    client.onopen = () => {
      console.log('WebSocket Client Connected');
    };
    const checkConnection = () => {
        if(client.readyState === 1){
     client.send(JSON.stringify({topic: "subscribe", to: "EURUSD:CUR"})).then((response)=> {
                console.log(response)
         })}
    }
    const sendMessage = () => {
            checkConnection()
            setTimeout(checkConnection(), 100000)
    }
    sendMessage()

    client.onmessage = (message) => {
      console.log(message);
    };
  }
  
  render() {
    return (
      <div>
        Hola.
      </div>
    );
  }
}

export default EURUSDrate;
